import React, { useState } from 'react';
import './Pictures.css';
import { makeStyles } from '@material-ui/core/styles';
import { entries } from './EntriesData.js'
import Grid from '@material-ui/core/Grid';
import FormLabel from '@material-ui/core/FormLabel';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import RadioGroup from '@material-ui/core/RadioGroup';
import Radio from '@material-ui/core/Radio';
import Paper from '@material-ui/core/Paper';
import { Button } from '@material-ui/core';

import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';

import YourComponent from "./Something.js";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
  },
  gridList: {
    width: 600,
    height: 600,
    paddingLeft: 150,
    paddingTop: 100
  },
  button:{
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    maxHeight: 75
  }
}));
const Nav = () => (
  <div>
         <Link to="/Something.js" className="btn btn-primary">hello</Link>
  </div>
);
export default function Pictures(props) {
  const [spacing, setSpacing] = React.useState(2);
  const classes = useStyles(); 
    return(
      <div className={classes.root}>
        <Router>
        <Nav/>
        <Route path="/Something.js" component={YourComponent}/>
        </Router>

        <GridList cellHeight={600}className={classes.gridList} cols={1}>
        <div className={classes.button}>
            <Button variant="contained"
          size="small"
          // fullWidth = true
          aria-label="add" className = {classes.root} onClick={() => { console.log("test") }}>{props.name}</Button>
          </div>
          {props.link.map((tile) => (
            <GridListTile key={tile} cols={tile.cols || 1}>
                  <img src={tile} alt={tile}/>
            </GridListTile>
          ))}
        </GridList>
      </div>
    )
}
